import React from 'react';

function Login() {
    return (
        <div>
            <label><b>Username</b></label>
            <input/>
            <label><b>Password</b></label>
            <input type="password"/>

            <button type="submit">Login</button>
            <label>
                <input type="checkbox" checked="checked"/> Remember me
            </label>
        </div>
    );
}

export default Login;
